import {Box, Button, Heading, Input, List, VStack} from "@chakra-ui/react";

function TaskPage() {
    return (
        <Box p={15} maxW="md" mx="auto">
            <Heading
                mb={"6"}
                textAlign={"center"}
                color={"green.500"}
            >
                Tasks
            </Heading>

            <Button>Create Task</Button>
            <Button>Delete Task</Button>



        </Box>
    );
}

export default TaskPage
